// MainNavBar.js

import React from 'react';
import { Routes, Route, Link } from 'react-router-dom';
import Home from './Home';
import About from './About';
import Contact from './Contact'
import PageNotFound from './PageNotFound'
import CustomerLogin from './../components/Login';
import CustomerSignIn from './../components/Signin'
import SellerLogin from './../Sellermenu/Sellerprofile/Slogin';
import SellerSignIn from './../Sellermenu/Sellerprofile/SRegistration'
import AdminLogin from './../admin/AdminLogin';
import './style.css';
// Change this line:
// export default function MainNavBar({onAdminLogin,onCustomerLogin,onSellerLogin}){

// To this:
function MainNavBar({onAdminLogin,onCustomerLogin,onSellerLogin}){
  return(
    <div>
      <nav>
      <ul>
      <li><Link to="/">Home</Link></li>
          <li><Link to="/about">About</Link></li>
          <i><Link to="/customerregistration">Customer Registartion</Link></i>
          <li className="dropdown">
            <Link>Login</Link>
          <div className="dropdown-content">
          <i><Link to="/customerlogin">Customer Login</Link></i>
          <i><Link to="/sellerlogin">Seller Login</Link></i>
          <i><Link to="/adminlogin">Admin Login</Link></i>
            </div>
          </li>
          
          
          <i><Link to="/contact">Contact</Link></i>
          </ul>

      </nav>
      <Routes>
      <Route path="/" element={<Home/>} exact />
        <Route path="/about" element={<About/>} exact />
        <Route path="/customerregistration" element={<CustomerSignIn/>} exact />
        <Route path="/customerlogin" element={<CustomerLogin onLogin={onCustomerLogin}/> }exact/>
        <Route path="/sellerregistration" element={<SellerSignIn/> }exact/>
        <Route path="/sellerlogin" element={<SellerLogin onJobSeekerLogin={onSellerLogin}/> }exact/>
        <Route path="/adminlogin" element={<AdminLogin onAdminLogin={onAdminLogin}/> }exact/>
        <Route path="/contact" element={<Contact/>} exact />
        <Route path="*" element={<PageNotFound/>} exact />
      </Routes>
    </div>

  );
}

// Add this line at the end of the file:
export default MainNavBar;
